    def try_move(grid, rx, ry, x, y, do_move):
        nx = rx + x
        ny = ry + y
        #nx1 = rx1 + x
        #ny1 = ry1 + y
        #nx2 = rx2 + x
        #ny2 = ry2 + y
        if grid[(nx, ny)] == ".": # and rx2 and grid[(nx2, ny2)] == ".":
            robo_moved = True if grid[(rx, ry)] == "@" else False
            if do_move:
                grid[(nx, ny)] = grid[(rx, ry)]  # Update new pos
                grid[(rx, ry)] = "."  # Update new pos
            return robo_moved, True, nx, ny
        elif grid[(nx, ny)] == "#":
            return False, False, rx, ry
        else:
            if x != 0:
                ok = True
                nxc, nyc = nx, ny
                while ok:
                    robo_moved, ok, _, _ = try_move(grid, nxc, nyc, x, y, True)
                    if robo_moved:
                        break
                    nxc -= x
                    nyc -= y
                if robo_moved:
                    return robo_moved, True, nx, ny
                else:
                    return robo_moved, ok, rx, ry
            else: # Move in y
                ok = True
                nxc, nyc = nx, ny
                grid_copy = copy.copy(grid)
