                while ok:
                    robo_moved, ok, _, _ = try_move(grid, nxc, nyc, x, y, True)
                    if robo_moved:
                        break
                    nxc -= x
                    nyc -= y
                
                dy = 1 if grid[(nx, ny)] == "[" else -1
                ok = True
                nxc, nyc = nx, ny + dy
                while ok:
                    robo_moved, ok, _, _ = try_move(grid, nxc, nyc, x, y, True)
